import React from "react";
import Select from "react-select";

const style = {
  control: (base) => ({
    ...base,
    border: 1,
    outline: "1px solid black",
  }),
};

export default function Selector({
  options,
  defaultValue,
  isSearchable,
  onChange,
}) {
  return (
    <Select
      styles={style}
      options={options}
      isSearchable={isSearchable}
      defaultValue={defaultValue}
      onChange={onChange}
      theme={(theme) => ({
        ...theme,
        borderRadius: 0,
        colors: {
          ...theme.colors,
          primary25: "#DFDFDF",
          primary: "#1e1e1e",
          primary50: "#DFDFDF",
          neutral0: "#F0F0F0",
          neutral20: "black",
          neutral30: "black",
          neutral90: "yellow",
        },
      })}
    />
  );
}
